    .bmnfrdpqy {
  display: flex;
  align-items: center;
  justify-content: center;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 999999;
  padding: 24px;
  background-color: rgba(0, 0, 0, 0.85);
}
.bmnfrdpqy__inner {
  background-color: white;
  color: #2a2b2c;
  width: 100%;
  max-width: 500px;
  border-radius: 2px;
  line-height: 1.875;
  font-size: 1rem;
  max-height: 100%;
  max-width: 700px;
}
.bmnfrdpqy__body {
  padding: 24px;
}
.bmnfrdpqy-modal__title {
  position: relative;
  padding-left: 24px;
  font-size: 1.5rem;
  font-weight: 900;
  line-height: 1;
}
.bmnfrdpqy-modal__title::after {
  content: '';
  display: block;
  width: 48px;
  height: 2px;
  background-color: black;
  margin-top: 8px;
}
.bmnfrdpqy-modal__text a {
  color: black;
}
