  color: black;
  font-size: 1rem;
  font-weight: 400;
  line-height: 1.5rem;
}
.bmnfrdpqy-modal__learn a {
  color: black;
}
.bmnfrdpqy-modal__browsers {
  padding-top: 12px;
  margin: 0 -6px;
}
.bmnfrdpqy-modal__browsers-button {
  flex: 1 0 auto;
  text-decoration: none;
  border-radius: 6px;
  background: whitesmoke;
  border-radius: 35px;
  padding: 12px;
  margin: 0 6px;
  border: 1px solid #d9d9d9;
  transition: .25s;
}
.bmnfrdpqy-modal__browsers-button img {
  width: 36px;
  height: 36px;
}
.bmnfrdpqy-modal__browsers-button:hover {
  background: #d9d9d9;
}
.bmnfrdpqy-modal__browsers--upgrade {
  line-height: 1;
  padding: 0 12px;
}
